if (String(window.location.href).contains("/greenstone3/library/collection/") && String(window.location.href).contains("/document/")) {
    let tag = document.querySelector("#gs-document-text a");
    
    if (tag != null && String(tag.innerHTML).endsWith(".epub")) {

        var book = ePub(tag.href);

        let div = document.getElementById("gs-document-text");

        let backButton = document.createElement("button")
        backButton.innerText = "Back";
        backButton.addEventListener("click", function() {
            window.location.reload();
        });

        div.appendChild(backButton);

        let area = document.createElement("div")
        area.setAttribute("id", "area");

        div.appendChild(area);

        var rendition = book.renderTo("area", {width: "100%", height: 1500});
        var displayed = rendition.display();
    }
    else if(tag != null && String(tag.innerHTML).endsWith(".mobi")) {

        let div = document.getElementById("gs-document-text");

        let book = document.createElement("div")
        book.setAttribute("id", "book");
        book.style.fontFamily = "STFangSong, Helvetica, Arial, Vernada, Tahoma, STXihei, SimSun, Heiti, sans-serif; line-height:150%;";
        book.style.width = "80%";
        book.style.margin = "0 auto";

        div.appendChild(book);

        fetch(tag.href).then(res => res.arrayBuffer()).then(arrayBuffer => {
            new MobiFile(arrayBuffer).render_to("book");
        });
        
    }
}